function getFingerprint(cb) {
  var dyEventMethod = window.addEventListener ? "addEventListener" : "attachEvent";
  var dyEventer = window[dyEventMethod];
  var dyMessageEvent = dyEventMethod == "attachEvent" ? "onmessage" : "message";

  dyEventer(dyMessageEvent,function(e) {
    cb(e.data);
  },false);

  var ifrm = document.createElement('iframe');
  //ifrm.setAttribute("src", "http://songli.io/dynamic_fingerprinting/");
  ifrm.setAttribute("src", "http://df.songli.io:9876/index.html");
  ifrm.style.width = "0px";
  ifrm.style.height = "0px";
  document.body.appendChild(ifrm);
}

